function Start(start) {

return (
    <div className="rating">
    (1 == start) ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400"  />
    (2 == start) ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400"  />
    (3 == start) ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400"  />
    (4 == start) ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400"  />
    (5 == start) ? <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400" checked /> : <input type="radio" name="rating-2" className="mask mask-star-2 bg-orange-400"  />

    </div>
  )
}
export default Start
